/*
Deployment script for TAgent
*/

GO
SET ANSI_NULLS, ANSI_PADDING, ANSI_WARNINGS, ARITHABORT, QUOTED_IDENTIFIER ON;

SET CONCAT_NULL_YIELDS_NULL, NUMERIC_ROUNDABORT OFF;


GO
:setvar DatabaseName "TAgent"
:setvar DefaultDataPath "D:\SQLData\"
:setvar DefaultLogPath "D:\SQLLog\"

GO
:on error exit
GO
USE [master]
GO
